import React from 'react'
import { useDispatch, useSelector } from 'react-redux'
import{increment,descrement} from './store'
export default function Counter() {
    const cntr=useSelector((data)=>data.counter.val);
    const dispatch=useDispatch()
  return (
    <div>
        <button onClick={()=>dispatch(increment())}>dark</button>
        <span>{cntr}</span>
        <button onClick={()=>dispatch(descrement())}>light</button>
    </div>
  )
}
